import React from 'react';
import { Route, Redirect, useNavigate } from 'react-router-dom';

const PrivateRoute = ({ component: Component, isAuthenticated, ...rest }) => {
    const navigate = useNavigate()
    return (
    <Route
        {...rest}
        render={(props) =>
        isAuthenticated ? (
            <Component {...props} />
        ) : (
            navigate('/eventos')
        )
        }
    />
  );
};

export default PrivateRoute;
